import styled from 'styled-components';
import COLORS from '../../styles/colors'
import { FONT_STYLES } from '../../styles/font-style';

import IcLocation from '../../assets/ic-location.png';
import IcAlarm from '../../assets/ic-alarm.png';
import ICSettings from '../../assets/ic-settings.png';


  const Styled = {
    Wrap: styled.div`
      display: flex;
      flex-direction: column;
    `,
    System: styled.div`
      width: 100%;
      height: 44px;
      background-color: ${COLORS.Gray100};
      ${FONT_STYLES.R_12}
    `,
    Header: styled.div`
      height: 52px;
      background-color: ${COLORS.Gray200};
    `,
    HeaderMargin: styled.div`
      margin: 18px 20px;
    `,
  }

  const Icon = {
    Location: styled.img`
      width: 16px;
      height: 16px;
      margin: 18px 20px;
    `,
    Alarm: styled.img``
  }


function Home() {
  return (
    <div>
      <Styled.System />
      <Styled.Header>
        <Icon.Location src={IcLocation}/>
      </Styled.Header>
    </div>
  )
}

export default Home
